@queencarolpls Ah sim. Vejo ela tentando o afastar pq sabe q é uma missão suicida.
Só não gostei das mentiras entre eles. Gostaria q ela se abrisse mais para ele não desconfiar.
Sempre tiveram confiança um no outro

@VirtudesSanchez Como ele vai fazer isso tudo se roubou milhões destinado a essas coisas?
Pelo amor de Deus. É um absurdo que quem cometa crimes nesse país seja solto e endeusado. Ser crápula aqui funciona.

Infelizmente, deixarei de lhe seguir, Virtudes. Esse senhor matou a ética.

